import { Routes, Route } from 'react-router-dom'

const AppRouter = () => {
  return (
    <Routes>
      <p>Hello</p>
      <Route path='/'>
        {/* <Route path='/' element='put your pages here' /> */}
        <p>Nothing here</p>
      </Route>
    </Routes>
  )
}

export default AppRouter;
